import React from 'react';
import Home from './components/Home';
import Navbar from './components/Navbar';
import AboutUs from './components/AboutUs';
import Services from './components/Services';
import Suscribe from './components/Suscribe';
import Destiny from './components/Destiny';
import Productos from './components/Productos';
import Contact from './components/Contact';
import Footer from './components/Footer';
import Terms from './components/Terms';


function App() {
  return (
    <div className="App">
      <body>
        <Home />
        <Navbar />
        <AboutUs />
        <Services />
        <Suscribe />
        <Destiny title={"Costa Rica's Hotels"} images={"portfolio-5.jpg","portfolio-4.jpg","portfolio-3.jpg","portfolio-2.jpg","portfolio-5.jpg"}/>
        <Destiny title={"International Hotels"} images={"","","","",""}/>
        <Productos title={"National Travels"}/>
        <Productos title={"International Travels"}/>
         <Terms/>
        <Contact />
        <Footer />

      </body>
    </div>
  );
}

export default App;
